export const pages_blocks_hero_split = sqliteTable(
  "pages_blocks_hero_split",
  {
    _order: integer("_order").notNull(),
    _parentID: integer("_parent_id").notNull(),
    _path: text("_path").notNull(),
    id: text("id").primaryKey(),
    bgVariant: text("bg_variant", { enum: ["bg-background", "bg-secondary"] }),
    slug: text("slug"),
    mediaSide: text("media_side", { enum: ["left", "right"] })
      .notNull()
      .default("right"),
    aspect: text("aspect", { enum: ["auto", "ratio"] })
      .notNull()
      .default("auto"),
    aspectRatio: numeric("aspect_ratio").default("1"),
    media: integer("media_id").references(() => media.id, {
      onDelete: "set null",
    }),
    content: text("content", { mode: "json" }),
    blockName: text("block_name"),
  },
  (columns) => ({
    _orderIdx: index("pages_blocks_hero_split_order_idx").on(columns._order),
    _parentIDIdx: index("pages_blocks_hero_split_parent_id_idx").on(
      columns._parentID,
    ),
    _pathIdx: index("pages_blocks_hero_split_path_idx").on(columns._path),
    pages_blocks_hero_split_slug_idx: uniqueIndex(
      "pages_blocks_hero_split_slug_idx",
    ).on(columns.slug),
    pages_blocks_hero_split_media_idx: index(
      "pages_blocks_hero_split_media_idx",
    ).on(columns.media),
    _parentIdFk: foreignKey({
      columns: [columns["_parentID"]],
      foreignColumns: [pages.id],
      name: "pages_blocks_hero_split_parent_id_fk",
    }).onDelete("cascade"),
  }),
);

