export const pages_blocks_accordion = sqliteTable(
  "pages_blocks_accordion",
  {
    _order: integer("_order").notNull(),
    _parentID: integer("_parent_id").notNull(),
    _path: text("_path").notNull(),
    id: text("id").primaryKey(),
    bgVariant: text("bg_variant", { enum: ["bg-background", "bg-secondary"] }),
    slug: text("slug"),
    content: text("content", { mode: "json" }),
    blockName: text("block_name"),
  },
  (columns) => ({
    _orderIdx: index("pages_blocks_accordion_order_idx").on(columns._order),
    _parentIDIdx: index("pages_blocks_accordion_parent_id_idx").on(
      columns._parentID,
    ),
    _pathIdx: index("pages_blocks_accordion_path_idx").on(columns._path),
    pages_blocks_accordion_slug_idx: uniqueIndex(
      "pages_blocks_accordion_slug_idx",
    ).on(columns.slug),
    _parentIdFk: foreignKey({
      columns: [columns["_parentID"]],
      foreignColumns: [pages.id],
      name: "pages_blocks_accordion_parent_id_fk",
    }).onDelete("cascade"),
  }),
);

export const blogSlider = sqliteTable(
  "blogSlider",
  {
    _order: integer("_order").notNull(),
    _parentID: integer("_parent_id").notNull(),
    _path: text("_path").notNull(),
    id: text("id").primaryKey(),
    content: text("content", { mode: "json" }),
    slug: text("slug"),
    blogs: integer("blogs_id").references(() => blogs.id, {
      onDelete: "set null",
    }),
    blockName: text("block_name"),
  },
  (columns) => ({
    _orderIdx: index("blogSlider_order_idx").on(columns._order),
    _parentIDIdx: index("blogSlider_parent_id_idx").on(columns._parentID),
    _pathIdx: index("blogSlider_path_idx").on(columns._path),
    blogSlider_slug_idx: uniqueIndex("blogSlider_slug_idx").on(columns.slug),
    blogSlider_blogs_idx: index("blogSlider_blogs_idx").on(columns.blogs),
    _parentIdFk: foreignKey({
      columns: [columns["_parentID"]],
      foreignColumns: [pages.id],
      name: "blogSlider_parent_id_fk",
    }).onDelete("cascade"),
  }),
);

