export const flexItems = sqliteTable(
  "flexItems",
  {
    _order: integer("_order").notNull(),
    _parentID: integer("_parent_id").notNull(),
    _path: text("_path").notNull(),
    id: text("id").primaryKey(),
    bgVariant: text("bg_variant", { enum: ["bg-background", "bg-secondary"] }),
    slug: text("slug"),
    content: text("content", { mode: "json" }),
    cardOptions_enabledMedia: integer("card_options_enabled_media", {
      mode: "boolean",
    }).default(true),
    cardOptions_enabledHeader: integer("card_options_enabled_header", {
      mode: "boolean",
    }).default(true),
    cardOptions_enabledHeaderLink: integer("card_options_enabled_header_link", {
      mode: "boolean",
    }).default(false),
    cardOptions_enabledHeaderRightText: integer(
      "card_options_enabled_header_right_text",
      { mode: "boolean" },
    ).default(false),
    cardOptions_enabledOverlay: integer("card_options_enabled_overlay", {
      mode: "boolean",
    }).default(false),
    cardOptions_enabledOverlayLink: integer(
      "card_options_enabled_overlay_link",
      { mode: "boolean" },
    ).default(false),
    cardOptions_enabledContent: integer("card_options_enabled_content", {
      mode: "boolean",
    }).default(false),
    cardOptions_enabledLink: integer("card_options_enabled_link", {
      mode: "boolean",
    }).default(false),
    cardOptions_aspectRatio: numeric("card_options_aspect_ratio").default("1"),
    cardOptions_overlayPosition: text("card_options_overlay_position", {
      enum: ["top", "bottom"],
    }).default("bottom"),
    cardOptions_maxColumns: text("card_options_max_columns", {
      enum: ["1", "2", "3", "4"],
    })
      .notNull()
      .default("3"),
    blockName: text("block_name"),
  },
  (columns) => ({
    _orderIdx: index("flexItems_order_idx").on(columns._order),
    _parentIDIdx: index("flexItems_parent_id_idx").on(columns._parentID),
    _pathIdx: index("flexItems_path_idx").on(columns._path),
    flexItems_slug_idx: uniqueIndex("flexItems_slug_idx").on(columns.slug),
    _parentIdFk: foreignKey({
      columns: [columns["_parentID"]],
      foreignColumns: [pages.id],
      name: "flexItems_parent_id_fk",
    }).onDelete("cascade"),
  }),
);

