export const navbar = sqliteTable("navbar", {
  id: integer("id").primaryKey(),
  updatedAt: text("updated_at").default(
    sql`(strftime('%Y-%m-%dT%H:%M:%fZ', 'now'))`,
  ),
  createdAt: text("created_at").default(
    sql`(strftime('%Y-%m-%dT%H:%M:%fZ', 'now'))`,
  ),
});

export const navbar_rels = sqliteTable(
  "navbar_rels",
  {
    id: integer("id").primaryKey(),
    order: integer("order"),
    parent: integer("parent_id").notNull(),
    path: text("path").notNull(),
    pagesID: integer("pages_id"),
    postsID: integer("posts_id"),
  },
  (columns) => ({
    order: index("navbar_rels_order_idx").on(columns.order),
    parentIdx: index("navbar_rels_parent_idx").on(columns.parent),
    pathIdx: index("navbar_rels_path_idx").on(columns.path),
    navbar_rels_pages_id_idx: index("navbar_rels_pages_id_idx").on(
      columns.pagesID,
    ),
    navbar_rels_posts_id_idx: index("navbar_rels_posts_id_idx").on(
      columns.postsID,
    ),
    parentFk: foreignKey({
      columns: [columns["parent"]],
      foreignColumns: [navbar.id],
      name: "navbar_rels_parent_fk",
    }).onDelete("cascade"),
    pagesIdFk: foreignKey({
      columns: [columns["pagesID"]],
      foreignColumns: [pages.id],
      name: "navbar_rels_pages_fk",
    }).onDelete("cascade"),
    postsIdFk: foreignKey({
      columns: [columns["postsID"]],
      foreignColumns: [posts.id],
      name: "navbar_rels_posts_fk",
    }).onDelete("cascade"),
  }),
);

