export const footer_blocks_links = sqliteTable(
  "footer_blocks_links",
  {
    _order: integer("_order").notNull(),
    _parentID: integer("_parent_id").notNull(),
    _path: text("_path").notNull(),
    id: text("id").primaryKey(),
    blockName: text("block_name"),
  },
  (columns) => ({
    _orderIdx: index("footer_blocks_links_order_idx").on(columns._order),
    _parentIDIdx: index("footer_blocks_links_parent_id_idx").on(
      columns._parentID,
    ),
    _pathIdx: index("footer_blocks_links_path_idx").on(columns._path),
    _parentIdFk: foreignKey({
      columns: [columns["_parentID"]],
      foreignColumns: [footer.id],
      name: "footer_blocks_links_parent_id_fk",
    }).onDelete("cascade"),
  }),
);

